function [RUC] = GetRUC(Constits, Vf, Vi, RUCid)
% +++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++
% Copyright 2020 United States Government as represented by the Administrator of the 
% National Aeronautics and Space Administration. No copyright is claimed in the 
% United States under Title 17, U.S. Code. All Other Rights Reserved. BY DOWNLOADING 
% OR USING THIS SOFTWARE, YOU ACKNOWLEDGE THAT YOU HAVE READ THE NASA OPEN SOURCE 
% AGREEMENT V1.3, THAT YOU UNDERSTAND IT, AND THAT YOU AGREE TO BE BOUND BY ITS 
% TERMS. IF YOU DO NOT AGREE TO THE TERMS AND CONDITIONS OF THIS AGREEMENT, DO NOT 
% USE OR DOWNLOAD THE SOFTWARE. THIS SOFTWARE IS PROVIDED AS IS WITHOUT ANY WARRANTY 
% OF ANY KIND. RECIPIENT AGREES TO WAIVE ANY AND ALL CLAIMS AGAINST, AND INDEMNIFIES 
% AND HOLDS HARMLESS, THE UNITED STATES GOVERNMENT, ITS CONTRACTORS AND 
% SUBCONTRACTORS, AS WELL AS ANY PRIOR RECIPIENT. This code was prepared by Drs. 
% B.A. Bednarcyk and S.M. Arnold to complement the book “Practical Micromechanics of 
% Composite Materials” during the course of their government work.
% +++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++
% Purpose: Obtain the repeating unit cell (RUC) information for GMC and HFGMC
% Input:
% - Constits: Struct containing constituent material information
% - Vf: Fiber volume fraction
% - Vi: Interface material volume fraction
% - RUCid: Repeating unit cell (RUC) id number
% Output:
% - RUC: Struct containing repeating unit cell (RUC) information
% +++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++

RUC.id = RUCid; % -- Store RUCid in the struct

F = Constits.Fiber.constID;
M = Constits.Matrix.constID;


% -- If Vf = 0, set to all matrix
if Vf == 0
    F = M;
    Vf = 0.25;
    if Vi ~= 0
        error('Vf = 0, Vi ~= 0 inadmissible (GetRUC.m)');
    end
end

% -- Store Vf and Vi in struct
RUC.Vf = Vf;
if Vi > 0
    I = Constits.Interface.constID;
    RUC.Vi = Vi;
end

% -- 2x2 RUC
if RUCid == 2
    RUC.NB = 2;
    RUC.NG = 2;
    RUC.Vf_max = 0.991;
    if (Vf >= RUC.Vf_max)
        disp([' Vf too large, Vf_max = ', num2str(RUC.Vf_max)]);
    else
        h1=sqrt(Vf);
        h2=1-h1;
        l1=h1;
        l2=h2;
        RUC.h = [h1, h2];
        RUC.l = [l1, l2];
        RUC.mats = [F, M; ...
                    M, M];
    end
    
% -- 3x3 RUC
elseif RUCid == 3
    RUC.NB = 3;
    RUC.NG = 3;
    RUC.Vf_max = 0.991; 
    if (Vf >= RUC.Vf_max)
        disp([' Vf too large, Vf_max = ', num2str(RUC.Vf_max)]);
    else
        h2=sqrt(Vf);
        h1=(1-h2)/2;
        h3=h1;
        RUC.h = [h1, h2, h3];
        RUC.l = RUC.h;
        RUC.mats = [M, M, M; ...
                    M, F, M;
                    M, M, M];
    end

    
% -- 7x7 RUC with step length = 1/4 of straight length,
%    modifies edge subcell dimensions to obtain desired Vf
elseif RUCid == 7
    RUC.NB = 7;
    RUC.NG = 7;
    RUC.Vf_max = 0.8125;
    if (Vf >= RUC.Vf_max)
        disp([' Vf too large, Vf_max = ', num2str(RUC.Vf_max)]);
    else
        h1 = (sqrt(13)*sqrt(Vf) - 4*Vf)/Vf;
        RUC.h = [h1, 1, 1, 4, 1, 1, h1];
        RUC.l = RUC.h;
        RUC.mats = [M, M, M, M, M, M, M; ...
                    M, M, M, F, M, M, M; ...
                    M, M, F, F, F, M, M; ...
                    M, F, F, F, F, F, M; ...
                    M, M, F, F, F, M, M; ...
                    M, M, M, F, M, M, M; ...
                    M, M, M, M, M, M, M];
    end    

elseif RUCid == 8 % -- For Problem 6.5
    RUC.NB = 24;
    RUC.NG = 24;
    RUC.Vf_max = 0.99;
    RUC.h = ones(RUC.NB,1);
    RUC.l = ones(RUC.NG,1);
    
    % -- Discontinuous
    RUC.mats = [M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
                M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M];
% 
%     % -- Overlap
%     RUC.mats = [M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...  
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, M, M, M, M, M, F, F, F, F, F, F, M, M, M, M, M, M];
% 
% 
%     % -- Continuous
%     RUC.mats = [M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M; ...
%                 M, M, M, M, M, M, M, F, F, F, F, F, F, F, F, F, F, M, M, M, M, M, M, M];
                   
% -- 26x26 RUC with option to add Extra subcells between fibers,
%    modifies edge subcell dimensions to obtain desired Vf
elseif RUCid == 26
    % -- Extra = # of subcells between fiber and edge of RUC (for HFGMC)
    Extra = 1;
%     Extra = 4;
    
    RUC.NB = 26 + 2*(Extra - 1);
    RUC.NG = 26 + 2*(Extra - 1);
    RUC.Vf_max = 0.80613; % -- Max Vf before fibers touch
    if (Vf >= RUC.Vf_max)
        disp([' Vf too large, Vf_max = ', num2str(RUC.Vf_max)]);
    else

        XH1_TOT = sqrt(3838.D0 / Vf) - 69.D0;
        XXH1 = XH1_TOT/Extra;

        XL1_TOT = XH1_TOT;
        XXL1 = XL1_TOT/Extra;

        for II = 1:Extra
           RUC.h(II) = XXH1;
           RUC.l(II) = XXL1;
        end

        shift = Extra - 1;     
        
        RUC.h(2 + shift)= 2.;
        RUC.h(3 + shift)= 3.;
        RUC.h(4 + shift)= 4.;
        RUC.h(5 + shift)= 3.;
        RUC.h(6 + shift)= 4.;
        RUC.h(7 + shift)= 5.;
        RUC.h(8 + shift)= 5.;
        RUC.h(9 + shift)= 4.;
        RUC.h(10 + shift)= 6.;
        RUC.h(11 + shift)= 9.;
        RUC.h(12 + shift)= 7.;
        RUC.h(13 + shift)= 17.;

        for I = 1: 12 + Extra - 1
           RUC.h(13 + Extra - 1 + I) = RUC.h(13 + Extra - I);
           RUC.l(13 + Extra - 1 + I) = RUC.h(13 + Extra - 1 + I);
           RUC.l(13 + Extra - I) = RUC.h(13 + Extra - I);
        end
        RUC.l(26 + 2*(Extra - 1)) = RUC.l(1);
        RUC.h(26 + 2*(Extra - 1)) = RUC.h(1);
         
        for IB = 1: RUC.NB
           for IG = 1: RUC.NG

              RUC.mats(IB, IG) = M;

              if ((IB == 2 + shift) || (IB == 25 + shift)) 
                 if ((IG >= 13 + shift) && (IG <= 14 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 3 + shift) || (IB == 24 + shift)) 
                 if ((IG >= 12 + shift) && (IG <= 15 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 4 + shift) || (IB == 23 + shift)) 
                 if ((IG >= 11 + shift) && (IG <= 16 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 5 + shift) || (IB == 22 + shift)) 
                 if ((IG >= 10 + shift) && (IG <= 17 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 6 + shift) || (IB == 21 + shift)) 
                 if ((IG >= 9 + shift) && (IG <= 18 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 7 + shift) || (IB == 20 + shift)) 
                 if ((IG >= 8 + shift) && (IG <= 19 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 8 + shift) || (IB == 19 + shift)) 
                 if ((IG >= 7 + shift) && (IG <= 20 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 9 + shift) || (IB == 18 + shift)) 
                 if ((IG >= 6 + shift) && (IG <= 21 + shift)) 
                    RUC.mats(IB, IG) = F;
                    RUC.matsCh(IB, IG) = 'F';
                 end
              elseif ((IB == 10 + shift) || (IB == 17 + shift)) 
                 if ((IG >= 5 + shift) && (IG <= 22 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 11 + shift) || (IB == 16 + shift)) 
                 if ((IG >= 4 + shift) && (IG <= 23 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 12 + shift) || (IB == 15 + shift)) 
                 if ((IG >= 3 + shift) && (IG <= 24 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              elseif ((IB == 13 + shift) || (IB == 14 + shift)) 
                 if ((IG >= 2 + shift) && (IG <= 25 + shift)) 
                    RUC.mats(IB, IG) = F;
                 end
              end
              
           end
        end         
         
    end

    
% -- Center notched material (number of subcells should be odd),
%    Vf interpreted as width fraction of notch
elseif RUCid == 30 || RUCid == 31 || RUCid == 32 || RUCid == 33
    
    switch RUCid
        case 30
            RUC.NB = 25;
        case 31
            RUC.NB = 51;
        case 32
            RUC.NB = 101;
        case 33
            RUC.NB = 201;
    end

    RUC.NG = RUC.NB;
    WidthFr = RUC.Vf;
    
    if mod(RUC.NB, 2) ~= 1 || mod(RUC.NG, 2) ~= 1
        error('NB and NG must be odd in center notched RUC (RUC = 30)')
    end
    
    RUC.Vf_max = 0.99;
    RUC.h = ones(RUC.NB,1);
    RUC.l = ones(RUC.NG,1);

    RUC.mats(1:RUC.NB, 1:RUC.NG) = M;
    row = round(RUC.NB/2);

    Nsubs = WidthFr*RUC.NG;
    NsubsOdd = 2*floor(Nsubs/2) + 1; % -- round to nearest odd integer


    if NsubsOdd < 5 % --- Need at least 5 subcells for dam zone
        disp([' WidthFr too small, NsubsOdd = ', num2str(NsubsOdd)]);
        error(' ');
        
    else
            
        % -- Spread notch width change needed to maintain Widthfr out 
        %    over middle three subcells
        l_prime = ( NsubsOdd - 3 - WidthFr*(RUC.NG - 3) )/( 3*(WidthFr - 1) );
        
        RUC.l(round(RUC.NG/2) - 1) = l_prime;
        RUC.l(round(RUC.NG/2)) = l_prime;
        RUC.l(round(RUC.NG/2) + 1) = l_prime;

        colstart = round(RUC.NG/2) - round(NsubsOdd/2) + 1;
        colend = colstart + NsubsOdd - 1;
        RUC.mats(row, colstart:colend) = F;
        
        widthcheck = 0;
        for i = 1: RUC.NB
            for j = 1: RUC.NG
                if RUC.mats(i,j) == M
                else
                    widthcheck = widthcheck + RUC.l(j);
                end
            end
        end
        
        widthcheck = widthcheck/sum(RUC.l);
        
    end
    
% -- Spot for user to put custom RUC
elseif RUCid == 99

    RUC.NB = 100;
    RUC.NG = 100;
    RUC.Vf_max = 0.99;
    RUC.h = ones(RUC.NB,1);
    RUC.l = ones(RUC.NG,1);

    % -- 100x100
    RUC.mats = [M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M,M; ...
