% -- 5x5 RUC with interface
elseif RUCid == 105
    RUC.NB = 5;
    RUC.NG = 5;
    RUC.Vf_max = 0.991 - Vi; 
    if (Vf >= RUC.Vf_max)
        disp([' Vf too large, Vf_max = ', num2str(RUC.Vf_max)]);
    else
        h3=sqrt(Vf);
        h2 = ( -h3+sqrt(h3^2 + Vi) )/2;
        h1=(1-2*h2-h3)/2;
        RUC.h = [h1, h2, h3, h2, h1];
        RUC.l = RUC.h;
        RUC.mats = [M, M, M, M, M; ...
                    M, I, I, I, M; ...
                    M, I, F, I, M; ...
                    M, I, I, I, M; ...
                    M, M, M, M, M];
    end
    
    
% -- 13x13 with interface (hardwired Vf and Vi)
elseif RUCid == 113
    % -- This code must be added by the user, see Exercise 5.6
    error('code for RUCid = 113 must be added by the user');
    
% -- Hex pack RUC with square subcells
elseif RUCid == 200
    RUC.Vf_max = 0.85;
    Target_Ni = 2;
%     Target_Ni = 8;
   
%     Target_NG = 20;
%     Target_NG = 40;
     Target_NG = 58;
%     Target_NG = 60;
%     Target_NG = 80;
%     Target_NG = 120;
%     Target_NG = 160;
%     Target_NG = 200;
%     Target_NG = 240;

    Plot = true; % -- Plot RUC when it is constructed
    
    [RUC.Vf,RUC.Vi,RawRUC]= RUCHex(Vf,Vi,Target_Ni,Target_NG,Plot);
    
    [RUC.NB, RUC.NG] = size(RawRUC);
    RUC.h = ones(1,RUC.NB);
    RUC.l = ones(1,RUC.NG);
   
    for B = 1: RUC.NB
        for G = 1: RUC.NG
            if RawRUC(B,G) == 1
                RUC.mats(B,G) = F;
            elseif RawRUC(B,G) == 2
                RUC.mats(B,G) = M;
            elseif RawRUC(B,G) == 3
                RUC.mats(B,G) = I;
            end
        end       
    end
    
% -- Random pack RUC with square subcells
elseif RUCid == 300
    RUC.Vf_max = 0.7;
    Nfibers = 10; % -- Number of fibers, default is 10
    Radf = 10;    % -- # subcells in radius, default is 10
    if (Vi > 0)
        Tint = 2; % -- # subcells for interface thickness 
    else
        Tint = 0;
    end
    touching = false; % -- Allow or disallow touching fibers/interfaces
    MaxTries = 4000;
    
%     Plot = false;
    Plot = true; % -- Plot RUC when it is constructed
    
    [RUC.Vf,RUC.Vi,RawRUC]= RUCRand(Vf,Radf,Nfibers,Tint,touching,MaxTries,Plot);
    
    [RUC.NB, RUC.NG] = size(RawRUC);
    RUC.h = ones(1,RUC.NB);
    RUC.l = ones(1,RUC.NG);
    for B = 1: RUC.NB
        for G = 1: RUC.NG
            if RawRUC(B,G) == 1
                RUC.mats(B,G) = F;
            elseif RawRUC(B,G) == 2
                RUC.mats(B,G) = M;
            elseif RawRUC(B,G) == 3
                RUC.mats(B,G) = I;
            end
        end       
    end

    
% -- Read RUC from json file
elseif RUCid == 1000
    
    % -- prompt for RUC json file
    [file,path] = uigetfile('*.json','Select json file containing RUC(s)');
    if isequal(file,0)
        error('        *** RUC json file selection canceled ***')
    end
    RUCFileName = [path, file];
    
    json = fileread(RUCFileName);
    jsondata = jsondecode(json);
    
    % -- fix matsCh
    for i = 1:length(jsondata.RUC)
        for b = 1:jsondata.RUC(i).NB
            for g = 1:jsondata.RUC(i).NG
                matsCh(b,g) = jsondata.RUC(i).matsCh{b}(g);
            end
        end
        jsondata.RUC(i).matsCh = matsCh;
        if isfield(jsondata.RUC(i), 'Vi')
            Vi = jsondata.RUC(i).Vi;
        else
            Vi = 0;
        end
        if isfield(jsondata.RUC(i), 'Mat')
            Mat = jsondata.RUC(i).Mat;
        elseif isfield(jsondata.RUC(i), 'plymat')
            Mat = jsondata.RUC(i).plymat;
        else
            Mat = 0;
        end
        list{i} = [num2str(jsondata.RUC(i).NB), ' by ', num2str(jsondata.RUC(i).NG), ...
                  ' - Vf = ', num2str(jsondata.RUC(i).Vf), ', Vi = ', num2str(Vi) , ...
                  ' - Mat = ', num2str(Mat)] ;
    end
    
    [index,tf] = listdlg('PromptString',{'Select RUC contained in json file',''},...
    'SelectionMode','single','ListSize',[300,250],'ListString',list);
    
    RUC = jsondata.RUC(index);
    RUC.id = RUCid;
    
    for b = 1: RUC.NB
        for g = 1: RUC.NG
            if RUC.matsCh(b,g) == 'F'
                RUC.mats(b,g) = Constits.Fiber.constID;
            elseif RUC.matsCh(b,g) == 'M'
                RUC.mats(b,g) = Constits.Matrix.constID;
            elseif RUC.matsCh(b,g) == 'I'
                RUC.mats(b,g) = Constits.Interface.constID;
            end                
        end
    end
   

else
    error(['Invalid RUCid, RUCid = ', num2str(RUCid)]);

end

% -- Setup the character material specifier (matsCh)
if isfield(RUC, 'mats')
    for i = 1: RUC.NB
        for j = 1: RUC.NG
            if RUC.mats(i,j) == M
                RUC.matsCh(i,j) = 'M';
            elseif RUC.mats(i,j) == F
                RUC.matsCh(i,j) = 'F';
            elseif RUC.mats(i,j) == I
                RUC.matsCh(i,j) = 'I';
            else
                error('Problem in GetRUC.m');
            end
        end
    end
end

end
